(CNN) -- 시리아 안보군에게 납치된 활동가 형제의 항복을 유도하기 위해 끌려간 젊은 여성이 베거나 절단되어 발견됐다는 보고서가 활동가와 인권단체들로부터 전해졌다. 19세인 자이나브 알후스니는 지난 달 홈스(Homs) 거주지에서 장보러 나갔으나 그녀의 가족은 이후 그녀를 다시 볼 수 없었다. 시리아 내에서 활동하는 반대 세력 단체 2개와 양심수위원회(Amnesty International)는 CNN과의 인터뷰에서, 안보군이 그녀를 손상된 시신으로 반환한 것으로 밝혔다. 고통 받은 보고서들로 인해 홈스와 전 세계적으로 분노가 일자, 수십 명의 여성들이 죽음에 대한 시위를 벌였다.
@highlight
"그들은 꽃 자이나브을 죽였습니다," 시위자들의 피켓팅
@highlight
유엔은 자이나브 알후스니 사망을 "충격적인" 이라고 평가합니다.
@highlight
많은 사람들은 여성이 형제에게 접근하기 위해 납치되었다고 말합니다.
